  \"2015-07-16T21:37:44.325707\",\n\t\"name\": \"water-feature-boundaries-national\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The hydro polygon/arc coverages (NTAD 2015)
  were created using TIGER/LINE 2000 shapefile data gathered from ESRI's Geography
  Network. The individual county hydrography line shapefiles were processed into Arc/Info
  coverages and then appended together to create complete state coverages. They were
  then edited to remove unwanted features, leaving a state-by-state database of both
  important and navigable water features. Attributes were added to denote navigable
  features and names. Also, an attribute was added to the polygons to denote which
  were water and which were land features. The state databases were then appended
  together to create a single, nationwide hydrography network containing named arcs
  and polygons. These features also contain a state FIPS. Because some of the hydro
  features are represented by lines instead of polygons, the complete hydro dataset
  consists of 2 shapefiles, one for lines and one for polygons. They must be used
  together to paint a complete picture.\",\n\t\"license_title\": null,\n\t\"extras\":
